import React, { Component } from 'react'
import { Typography } from '@material-ui/core';

interface Idata{
    title?: string,
    teacher?: string,
    deadline?: string,
    scienceArea?: string,
    description?: string,
    reportFile?: string,
    presentationFile?: string,
    consultantReportFile?: string,
    link?: string,
    teacherContacts?: string,
    consultant?: string,
    consultantContacts?: string,
    critic?: string,
    status?: string,
    teacherReview?: string
}

interface Props{
    data : Idata
}

interface State{

}

class RequestDetail extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderRequestDetail(){
        return(
            <div>
                <div><Typography variant='h4'>{this.props.data.title}</Typography></div>
            </div>
        )
    }

    render(){
        return this.renderRequestDetail();
    }
}

export default RequestDetail
